import React, { Component } from 'react'
import '../assets/css/ListOfColor.css'

export class ListOfColors extends Component {
    render() {
        return (
            <div style={{display:"flex"}}>
                <div className="colorDiv">1</div>
                <div className="colorDiv">2</div>
                <div className="colorDiv">3</div>
                <div className="colorDiv">4</div>
            </div>
        )
    }
}

export default ListOfColors
